import React, { Component } from "react";
import {
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBInput,
  MDBBtn,
  MDBIcon,
  MDBCard,
  MDBCardBody,
  MDBModal,
  MDBModalBody,
  MDBModalFooter,
  MDBStreak
} from "mdbreact";

import logo from "./H2Studio-small.png";

import TopNav from "./TopNavigationBar";
import SectionContainer from "./sectionContainer";
import CategoryCard from "./productCards/CategoryCard";

const Home = props => {
  console.log("PROPS: ", props);

  //Category card
  let categoryCards = [];

  return (
    <div>
      <TopNav />
      <MDBContainer style={{ height: "2000px" }}>
        {/* <MDBStreak
          size="md"
          by="Steve Jobs"
          overlayClass="white-text rgba-black-light pattern-1"
          photo="https://mdbootstrap.com/img/Photos/Horizontal/Nature/12-col/img(115).jpg"
        >
          The people who are crazy enough to think they can change the world are
          the ones who do
        </MDBStreak> */}
        <MDBStreak
          size="md"
          //   by="Steve Jobs"
          overlayClass="white-text rgba-black-light pattern-1"
          photo="https://mdbootstrap.com/img/Photos/Horizontal/Nature/12-col/img(115).jpg"
        />

        <MDBRow style={{ marginTop: "20px" }}>
          <MDBCol md="4">
            <CategoryCard />
          </MDBCol>
          <MDBCol md="4">
            <CategoryCard />
          </MDBCol>
          <MDBCol md="4">
            <CategoryCard />
          </MDBCol>
        </MDBRow>
        <MDBRow>
          <MDBCol>
            <image src="https://imgur.com/aZ9Vyzi" alt="logo" />

            {/* <image src={require("./H2Studio-small.png")} alt="image" /> */}
            {/* <image
              src={process.env.PUBLIC_URL + "H2Studio-small.png"}
              alt="image"
            /> */}
          </MDBCol>
        </MDBRow>
      </MDBContainer>
    </div>
  );
};
export default Home;
